import React, { useState } from 'react';
import LoginForm from './pages/LoginForm';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  return (
    <div>
      <LoginForm setIsLoggedIn={setIsLoggedIn} />
      {/* other components */}
    </div>
  );
}

export default App;
